import React, { useState } from "react";
import { Link } from "react-router-dom";

const TopNav = (props) => {
  const [isNavCollapsed, setIsNavCollapsed] = useState(true);

  const handleNavCollapse = () => setIsNavCollapsed(!isNavCollapsed);

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light rounded">
      <a className="navbar-brand text-info font-weight-bolder" href="/">
        <img
          src="https://cdn.eso.org/images/thumb300y/eso1907a.jpg"
          alt="Logo"
          width="36"
          height="36"
          className="vertical-align-middle"
        />
        <span className="">Discounter</span>
      </a>

      <div
        class={`${isNavCollapsed ? "collapse" : ""} navbar-collapse`}
        id="navbarsExample09"
      >
        <Link className="nav-link text-info" to={"/gen1"}>
          Gen1
        </Link>
        <Link className="nav-link text-info" to={"/gen2"}>
          Gen2
        </Link>
        <a
          href="/request-demo"
          className="btn btn-sm btn-info nav-link text-white"
        >
          Request demo
        </a>
      </div>
    </nav>
  );
};

export default TopNav;
